import React from 'react';
import Link from 'next/link';
import Layout from './components/AdminLayout';


const Admin = () =>{


  
    return(
<Layout>
   <div className="admin">   
      <h1>Admin Page</h1>
  <div className="panels"> 
  
    <div className="news-panel">
        <h2> News Panel</h2>
        <ul>
            <li>
            <Link href="#"><a>View all news</a></Link>
            </li>
            <li>
                <Link href="#"><a>Write a new article</a></Link>
            </li>
        </ul>
    </div>

    <div className="job-panel">
        <h2>Admin Panel</h2>
        <ul>
            <li>
                <Link href="#"><a>View all job posting</a></Link>
            </li>
            <li>
                <Link href="#"><a>New Job Posting</a></Link>
            </li>
            </ul>
    </div>
    </div>
  </div>

  <style jsx>
      {`
      .admin{
          margin: 2em;
         
      }

      .panels{
        display: flex;
          flex-wrap: wrap;
          background-color:rgb(243, 248, 248);
          min-height: 50vh;
      }
      
      `}
  </style>
</Layout>

    );
  
}
export default Admin;
